import { initializeApp } from "firebase/app";
import { getAuth } from "firebase/auth";
import { getAnalytics } from "firebase/analytics";

//Web App's Firebase Config
const firebaseConfig = {
    apiKey: process.env.REACT_APP_FIREBASE_API_KEY/*"AIzaSyCpMQv7pDb7UibqOhgrzEzVUriBmfX3fQY"*/,
    authDomain: process.env.REACT_APP_FIREBASE_AUTH_DOMAIN/*"footsies-soccer-trainer.firebaseapp.com"*/,
    databaseURL: process.env.REACT_APP_FIREBASE_DATABASE_URL/*"https://footsies-soccer-trainer-default-rtdb.firebaseio.com"*/,
    projectId: process.env.REACT_APP_FIREBASE_PROJECT_ID/*"footsies-soccer-trainer"*/,
    storageBucket: process.env.REACT_APP_FIREBASE_STORAGE_BUCKET/*"footsies-soccer-trainer.firebasestorage.app"*/,
    messagingSenderId: process.env.REACT_APP_FIREBASE_MESSAGING_SENDER_ID/*"432994976250"*/,
    appId: process.env.REACT_APP_FIREBASE_APP_ID/*"1:432994976250:web:561c519add9347bb16a443"*/,
    measurementId: process.env.REACT_APP_FIREBASE_MEASUREMENT_ID/*"G-2GYVWS2Q3V"*/
};

//Initialize Firebase
const app = initializeApp(firebaseConfig);
const analytics = getAnalytics(app);
export const auth = getAuth(app);
